import React from "react"
 class Navbar extends React.Component{
     render(){
         return(
             <>
             <div className="nav">
                 <div className="left-nav">arsh</div>
                 <div className="right-nav">khan</div>
             </div>
             </>
         )
     }
 }
 export default Navbar
